        /// <summary>
        /// 拼音元音集合
        /// </summary>
        public static char[] VowelArray = { 'a', 'e', 'i', 'o', 'u', 'v' };
        /// <summary>
        /// 元音字符串
        /// </summary>
        public static String VowelString = "aeiouv";

        /// <summary>
        /// 给拼音添加声调
        /// </summary>
        /// <param name="pinyin"></param>
        /// <returns></returns>
        public static String PinYinWithTonal(String pinyin)
        {
            int tonal = int.Parse(pinyin.Substring(pinyin.Length - 1, 1));
            pinyin = pinyin.Substring(0, pinyin.Length - 1);
            var index = TonalIndex(pinyin);
            var list = pinyin.ToList<Char>();
            list[index] = SetTonal(pinyin[index], tonal);
            var result = "";
            foreach (var item in list)
            {
                result += item.ToString();
            }
            return result;
        }

        /// <summary>
        /// 计算声调的位置
        /// </summary>
        /// <param name="pinyin"></param>
        /// <returns></returns>
        public static int TonalIndex(String pinyin)
        {
            var index = -1; var result = -1;
            foreach (var l in pinyin)
            {
                var list = VowelArray.ToList();
                foreach (var i in list)
                {
                    if (l == i)
                    {
                        var current = list.IndexOf(i);
                        if (index == -1)
                        {
                            index = current;
                            result = pinyin.IndexOf(l);
                        }
                        else
                        {
                            if (index > current)
                            {
                                index = current;
                                result = pinyin.IndexOf(l);
                            }
                        }
                        //index = index == -1 ? current : (index > current ? current : index);
                    }
                }
            }
            return result;
        }

        /// <summary>
        /// 设置声调
        /// </summary>
        /// <param name="letter"></param>
        /// <param name="tonal"></param>
        /// <returns></returns>
        public static char SetTonal(Char letter, Int32 tonal)
        {
            switch (letter)
            {
                case 'a':
                    return VowelA[tonal];
                case 'e':
                    return VowelE[tonal];
                case 'i':
                    return VowelI[tonal];
                case 'o':
                    return VowelO[tonal];
                case 'u':
                    return VowelU[tonal];
                default:
                case 'V':
                    return VowelV[tonal];
            }
        }
        public static Char[] VowelA = { 'a', 'ā', 'á', 'ǎ', 'à' };
        public static Char[] VowelE = { 'e', 'ē', 'é', 'ě', 'è' };
        public static Char[] VowelI = { 'i', 'ī', 'í', 'ǐ', 'ì' };
        public static Char[] VowelO = { 'o', 'ō', 'ó', 'ǒ', 'ò' };
        public static Char[] VowelU = { 'u', 'ū', 'ú', 'ǔ', 'ù' };
        public static Char[] VowelV = { 'ü', 'ǖ', 'ǘ', 'ǚ', 'ǜ' };
    }
